css:
atom-text-editor,
:host {
  background-color: #eeefe1;
  color: #000000;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: #c5c8c6;
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #333431;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #929292;
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #222321;
  color: #c5c8c6;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: #333431;
  color: #c5c8c6;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #c5c8c6;
}
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #aaafa1;
}
atom-text-editor .invisible,
:host .invisible {
  color: #000000;
}
atom-text-editor .cursor,
:host .cursor {
  color: #000000;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #c1c3b1;
}
atom-text-editor .search-results .marker .region,
:host .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #aaafa1;
}
atom-text-editor .search-results .marker.current-result .region,
:host .search-results .marker.current-result .region {
  border: 1px solid #ffffff;
}
.comment {
  color: #aaafa1;
  font-style: italic;
}
.keyword {
  color: #2a6bc9;
}
.keyword.control {
  color: #2a6bc9;
}
.keyword.operator {
  color: #000000;
}
.keyword.other.special-method {
  color: #2a6bc9;
}
.keyword.other.unit {
  color: #2a6bc9;
}
.storage {
  color: #2a6bc9;
  font-weight: bold;
}
.constant {
  color: #478b47;
}
.constant.character.escape {
  color: #8962a6;
}
.constant.numeric {
  color: #478b47;
}
.constant.other.color {
  color: #8962a6;
}
.constant.other.symbol {
  color: #478b47;
}
.variable {
  color: #2a6bc9;
}
.variable.interpolation {
  color: #21559f;
}
.variable.parameter.function {
  color: #000000;
}
.invalid.illegal {
  background-color: #cc6666;
  color: #eeefe1;
}
.string {
  color: #478b47;
}
.string.regexp {
  color: #8962a6;
}
.string.regexp .source.ruby.embedded {
  color: #de935f;
}
.string.other.link {
  color: #cc6666;
}
.punctuation.definition.comment {
  color: #aaafa1;
}
.punctuation.definition.string,
.punctuation.definition.variable,
.punctuation.definition.parameters,
.punctuation.definition.array {
  color: #000000;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #957e35;
}
.punctuation.definition.bold {
  color: #f0c674;
  font-weight: bold;
}
.punctuation.definition.italic {
  color: #8962a6;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #bf4040;
}
.support.class {
  color: #957e35;
}
.support.function {
  color: #2a6bc9;
}
.support.function.any-method {
  color: #2a6bc9;
}
.entity.name.function {
  color: #2a6bc9;
}
.entity.name.type {
  color: #2a6bc9;
}
.entity.other.inherited-class {
  color: #478b47;
}
.entity.name.class,
.entity.name.type.class {
  color: #478b47;
}
.entity.name.section {
  color: #2a6bc9;
}
.entity.name.tag {
  color: #2a6bc9;
}
.entity.other.attribute-name {
  color: #957e35;
}
.meta.class {
  color: #f0c674;
}
.meta.link {
  color: #de935f;
}
.meta.require {
  color: #2a6bc9;
}
.meta.selector {
  color: #8962a6;
}
.meta.separator {
  background-color: #333431;
  color: #000000;
}
.none {
  color: #000000;
}
.markup.bold {
  color: #de935f;
  font-weight: bold;
}
.markup.changed {
  color: #8962a6;
}
.markup.deleted {
  color: #cc6666;
}
.markup.italic {
  color: #8962a6;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #2a6bc9;
}
.markup.inserted {
  color: #478b47;
}
.markup.list {
  color: #cc6666;
}
.markup.quote {
  color: #de935f;
}
.markup.raw.inline {
  color: #478b47;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #478b47;
}
atom-text-editor[mini] .scroll-view,
:host([mini]) .scroll-view {
  padding-left: 1px;
}
@-webkit-keyframes bracketanimation {
  from {
    background: #c1c3b1;
  }
  to {
    background: #c1c3b1;
  }
}
.bracket-matcher .region {
  border-bottom: 0;
}
.bracket-matcher .region:after {
  content: "";
  -webkit-animation-name: bracketanimation;
  -webkit-animation-duration: .6s;
  border: 0px;
  background-color: rgba(0, 0, 0, 0);
  width: 100%;
  height: 100%;
  position: absolute;
}
.tab-bar .tab::before {
  background: rgba(0, 0, 0, 0);
}
.tooltip {
  background: #c1c3b1;
}
.tooltip .tooltip-inner {
  background: #c1c3b1;
}
